import React from "react";

function SideBarComponent() {
  return (
    <aside className="sidebar">
      <ul>
        <li>Home</li>
        <li>Saved Recipes</li>
        <li>Friends</li>
      </ul>
    </aside>
  );
}

export default SideBarComponent;
